commit.message:
Correct ARGV_BOOL_NEG size from sizeof(int) to sizeof(char) (#61)

match the code in string_to_value:
  case ARGV_BOOL_NEG:
    /* if no close argument, set to false */
    if (arg == NULL) {
      *(char *)var = ARGV_FALSE;
    }
and value_to_string:
  case ARGV_BOOL:
  case ARGV_BOOL_NEG:
  case ARGV_BOOL_ARG:
    if (*(char *)var) {
      strncpy(buf, "true (! 0)", buf_size);
    }
    else {
      strncpy(buf, "false (0)", buf_size);
    }
    buf[buf_size - 1] = '\0';
    len = strlen(buf);
    break;

Signed-off-by: Xiang Xiao <xiaoxiang@xiaomi.com>
Change-Id: I243ff2498aeb60316d6e41dfeeb7a87653336b36

